[[package]]
name = "asttokens"
version = "2.0.5"
summary = "Annotate AST trees with source code positions"
dependencies = [
    "six",
]

[[package]]
name = "certifi"
version = "2021.5.30"
summary = "Python package for providing Mozilla's CA Bundle."

[[package]]
name = "charset-normalizer"
version = "2.0.4"
requires_python = ">=3.5"
summary = "The Real First Universal Charset Detector. Open, modern and actively maintained alternative to Chardet."

[[package]]
name = "colorama"
version = "0.4.4"
requires_python = ">=2.7,!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*"
summary = "Cross-platform colored terminal text."

[[package]]
name = "executing"
version = "0.8.0"
summary = "Get the currently executing AST node of a frame, and other information"

[[package]]
name = "icecream"
version = "2.1.1"
summary = "Never use print() to debug again; inspect variables, expressions, and program execution with a single, simple function call."
dependencies = [
    "asttokens>=2.0.1",
    "colorama>=0.3.9",
    "executing>=0.3.1",
    "pygments>=2.2.0",
]

[[package]]
name = "idna"
version = "3.2"
requires_python = ">=3.5"
summary = "Internationalized Domain Names in Applications (IDNA)"

[[package]]
name = "pygments"
version = "2.10.0"
requires_python = ">=3.5"
summary = "Pygments is a syntax highlighting package written in Python."

[[package]]
name = "PyJWT"
version = "2.1.0"
requires_python = ">=3.6"
summary = "JSON Web Token implementation in Python"

[[package]]
name = "requests"
version = "2.26.0"
requires_python = ">=2.7,!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*,!=3.5.*"
summary = "Python HTTP for Humans."
dependencies = [
    "certifi>=2017.4.17",
    "charset-normalizer~=2.0.0; python_version >= \"3\"",
    "idna<4,>=2.5; python_version >= \"3\"",
    "urllib3<1.27,>=1.21.1",
]

[[package]]
name = "six"
version = "1.16.0"
requires_python = ">=2.7,!=3.0.*,!=3.1.*,!=3.2.*"
summary = "Python 2 and 3 compatibility utilities"

[[package]]
name = "urllib3"
version = "1.26.6"
requires_python = ">=2.7,<4.0,!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*"
summary = "HTTP library with thread-safe connection pooling, file post, and more."

